import React, { Component } from 'react';

function Comment(props) {
        return (
            <div className="row">
                <div className="col-2">
                    <img src={props.photoURL} alt="/" style={{borderRadius: "50%", height:"10px"}}></img>
                </div>
                <div className="col-10"></div>
            </div>
        );
    }

export default Comment;
